sys_variable_value.value:
(function execute(inputs, outputs) {
  	var xmlDoc = new XMLDocument2();
  	xmlDoc.parseXML(inputs.response);
  	outputs.delivery_status = xmlDoc.getFirstNode('//trk:Status/trk:Description').getTextContent();
  	outputs.delivery_date = xmlDoc.getFirstNode('//trk:Shipment/trk:Package/trk:DeliveryDate') ? xmlDoc.getFirstNode('//trk:Shipment/trk:Package/trk:DeliveryDate').getTextContent() : '';
  	outputs.projected_delivery_date = xmlDoc.getFirstNode('//trk:DeliveryDetail/trk:Date') ? xmlDoc.getFirstNode('//trk:DeliveryDetail/trk:Date').getTextContent() : '2020-07-26T09:30:00-05:00';
})(inputs, outputs);

